107 minuten

goed

met de stemmen van Jamie Bell, Andy Serkis en Daniel Craig

De nieuwsgierige reporter Kuifje en zijn trouwe hondje Bobbie ontdekken dat een model van het prachtige oude zeilschip 'De 
Eenhoorn' een geheim met zich meedraagt. Meegevoerd in een eeuwenoud mysterie, krijgt hij het aan de stok met de boosaardige 
Sacharin, die weet dat Kuifje een belangrijke aanwijzing bezit naar de grote schat van de snode piraat Scharlaken Rackham. 
Geholpen door de moedige Bobbie, de onstuimige kapitein Haddock en de stuntelige detectives Jansen en Janssen, reist Kuifje de 
halve wereld af, constant op de hielen gezeten door de vijand. Hij moet slimmer en sneller zijn dan de rest om het Geheim van de 
Eenhoorn te ontrafelen...
